import Link from "next/link";
import styles from "./SideBarNav.module.css";

const SideBarNav = () => (
  <nav class="container">
    <div class={styles.sidebarcontainer}>
      <Link href="/">
        <a class="nav-link p-1">Home</a>
      </Link>
      <Link href="/search">
        <a class="nav-link p-1">Search</a>
      </Link>
    </div>
  </nav>

);

export default SideBarNav;
